                  <div className='flex'>
                    <p
                      style={{ fontFamily: 'airbnb-book' }}
                      className='text-sm'>
                      {selectedCountry.full}
                    </p>
                  </div>
                  <div className='flex'>
                    <p
                      style={{ fontFamily: 'airbnb-book' }}
                      className='text-sm text-gray-650'>
                      {selectedCountry.abbreviation}{' '}
                      {selectedCountry.abbreviation === null ? null : '-'}{' '}
                      {selectedCountry.symbol}
                    </p>
                  </div>
                </div>
              </button>
            </div>
            {filteredCurrencies.map((currency, index) => {
              return (
                <div className='w-1/5 flex mb-2'>
                  <button className='hover:bg-gray-250 w-90p rounded-lg flex justify-center'>
                    <div className='w-80p py-1'>
                      <div className='flex'>
                        <p
                          style={{ fontFamily: 'airbnb-book' }}
                          className='text-sm'>
                          {currency.full}
                        </p>
                      </div>
                      <div className='flex'>
                        <p
                          style={{ fontFamily: 'airbnb-book' }}
                          className='text-sm text-gray-650'>
                          {currency.abbreviation}{' '}
                          {currency.abbreviation === null ? null : '-'}{' '}
                          {currency.symbol}
                        </p>
                      </div>
                    </div>
                  </button>
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </>
  );
};
